import React from "react";
// import StyledLogo from "./style.js";
// import PropTypes from "prop-types";
import Image from "./citrus-logo.svg";

const SVG = ({
  style = {},
  fill = "#fff",
  width = "100px",
  className = "",
  height = "100%",
  viewBox = "0 0 32 32"
}) => (
  <svg
    width={width}
    style={style}
    height={height}
    viewBox={viewBox}
    className={className}
    xmlns={Image}
    xmlnsXlink="http://www.w3.org/1999/xlink"
  >
    <path d="some path here" fill={fill} />
  </svg>
);

// Logo.propTypes = {
//   text: PropTypes.string
// };

export default SVG;
